import React from 'react';
import './About.css';
import Navbar from '../../Components/Navbar/Navbar';
import Footer from '../../Components/Footer/Footer';

const About = () => {
  return (
    <>
        <Navbar/>
        <div className="about-container">
            <div className='para'>
                <h1>About Us</h1>
                <p>Welcome to our Language Proficiency Tracker! We are dedicated to helping you improve your language skills in an interactive and engaging way.</p>
      <p>Our platform offers a variety of language tests, including vocabulary, sentence understanding, sentence correction, and error correction, designed to cater to learners of different proficiency levels.</p>
      <p>Whether you're learning English, Hindi, Japanese, French, Spanish, Tamil, or any other language, our goal is to provide you with the tools and resources you need to succeed.</p>
      <p>Join us on your language learning journey and unlock your full potential!</p>
            </div>
        </div>

        <Footer/>
    </>
  );
};

export default About;
